if(!Number.getRandom){Number.getRandom=function(min,max){min=Math.ceil(min||0);max=Math.floor(max||min*min);return Math.floor(Math.random()*(max-min+1))+min}}if(!Number.prototype.log){Number.prototype.log=function(){console.log(this.constructor.toString().split(" ")[1].replace("()","").toLowerCase()+"("+this.toString().length+"): "+this.toString())}}